var fileJSON=[{"path":"/homes/connie/opencl/CNN/cnn_test/device/cnn.cl", "name":"cnn.cl", "has_active_debug_locs":false, "absName":"/homes/connie/opencl/CNN/cnn_test/device/cnn.cl", "content":"/*****************************************************************************\012 * Copyright (c) 2013-2016 Intel Corporation\012 * All rights reserved.\012 *\012 * WARRANTY DISCLAIMER\012 *\012 * THESE MATERIALS ARE PROVIDED BY THE COPYRIGHT HOLDERS AND CONTRIBUTORS\012 * \"AS IS\" AND ANY EXPRESS OR IMPLIED WARRANTIES, INCLUDING, BUT NOT\012 * LIMITED TO, THE IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS FOR\012 * A PARTICULAR PURPOSE ARE DISCLAIMED. IN NO EVENT SHALL INTEL OR ITS\012 * CONTRIBUTORS BE LIABLE FOR ANY DIRECT, INDIRECT, INCIDENTAL, SPECIAL,\012 * EXEMPLARY, OR CONSEQUENTIAL DAMAGES (INCLUDING, BUT NOT LIMITED TO,\012 * PROCUREMENT OF SUBSTITUTE GOODS OR SERVICES; LOSS OF USE, DATA, OR\012 * PROFITS; OR BUSINESS INTERRUPTION) HOWEVER CAUSED AND ON ANY THEORY\012 * OF LIABILITY, WHETHER IN CONTRACT, STRICT LIABILITY OR TORT (INCLUDING\012 * NEGLIGENCE OR OTHERWISE) ARISING IN ANY WAY OUT OF THE USE OF THESE\012 * MATERIALS, EVEN IF ADVISED OF THE POSSIBILITY OF SUCH DAMAGE.\012 *\012 * Intel Corporation is the author of the Materials, and requests that all\012 * problem reports or change requests be submitted to it directly\012 *****************************************************************************/\012\012#include \"../host/inc/instance.h\"\012\012__attribute((reqd_work_group_size(1, 1, 1)))\012__kernel void cnn(__global float* const restrict input, __global float* const restrict weights, __global float* restrict output, \012                    const int Tm, const int Tr, const int Tc, const int Tn)\012{\012	//unsigned long too = get_global_id(0) * Tm;\012	//unsigned long roo = get_global_id(1) * Tr;\012	//unsigned long coo = get_global_id(2) * Tc;\012	\012	unsigned long too, roo, coo, tii, noo;\012	unsigned long ti, row, col, to, no;\012\012    __local float BufO[max_Tm][max_Tr][max_Tc];\012\012    // only need to zero BufO in this loop ordering\012	{\012		// indices internal to the block: count from 0\012		unsigned long ioo, icc, irr;\012	  \012		for(ioo=0;ioo<max_Tm;ioo++) {\012			for(irr=0;irr<max_Tr;irr++) {\012				for(icc=0;icc<max_Tc;icc++) {\012					BufO[ioo][irr][icc]=0;\012				}\012			}\012		}\012	}\012\012	for(roo=0; roo<R_ofm; roo+=Tr) {\012		for(coo=0; coo<C_ofm; coo+=Tc) {\012			for(too=0; too<M_ofm; too+=Tm) {\012                for (noo=0; noo<N_ifm; noo+=Tn){\012                    for(row=roo; row<MIN(roo+Tr, R_ofm); row++) {\012                        for(col=coo; col<MIN(coo+Tc, C_ofm); col++) {\012                            for(to=too; to<MIN(too+Tm, M_ofm); to++) {\012                                for (no=noo; no<MIN(noo+Tn, N_ifm); no++){\012                                    unsigned long i, j;\012                                    #pragma unroll\012                                    for(i=0; i<K_wts; i++) {\012                                        #pragma unroll\012                                        for(j=0; j<K_wts; j++) {\012                                            // printf(\"CNN: roo: %lu, coo: %lu, too: %lu, noo, %lu.\\n\", roo, coo, too, noo);\012                                            // printf(\"CNN: row: %lu, col: %lu, to: %lu, no, %lu.\\n\", row, col, to, no);\012                                            BufO[to][row][col]+= \012                                            ARRAY(weights,to,no,i,j,M_ofm,N_ifm,K_wts,K_wts)*\012                                            ARRAY(input,0,no,S_wts*row+i,S_wts*col+j,0,N_ifm,R_ifm,C_ifm);\012                                            // printf(\"CNN: temp output = %f.\\n\", BufO[to][row][col]);\012                                        }\012                                    }\012                                }\012                                if (noo + Tn >= N_ifm) {\012                                    // printf(\"CNN: M: %lu, R: %lu, C: %lu.\\n\", to, row, col);\012                                    // printf(\"CNN: value: %f.\\n\", BufO[to][row][col]);\012                                    ARRAY(output,0,to,row,col,0,M_ofm,R_ofm,C_ofm) = BufO[to][row][col];\012                                    BufO[to][row][col] = 0;\012                                    // printf(\"CNN: zero DONE.\\n\");\012                                }\012                            }\012                        }\012                    }\012                }\012			}\012		}\012	}\012}\012"}, {"path":"/homes/connie/opencl/CNN/cnn_test/device/../host/inc/instance.h", "name":"instance.h", "has_active_debug_locs":false, "absName":"/homes/connie/opencl/CNN/cnn_test/host/inc/instance.h", "content":"#ifndef INSTANCE_H\012#define INSTANCE_H\012\012/****************************************************************\012 * Copyright (c) 2017~2019, 18-643 Course Staff, CMU\012 * All rights reserved.\012\012 * Redistribution and use in source and binary forms, with or without\012 * modification, are permitted provided that the following conditions\012 * are met:\012\012 * 1. Redistributions of source code must retain the above copyright\012 *    notice, this list of conditions and the following disclaimer.\012\012 * 2. Redistributions in binary form must reproduce the above\012 *    copyright notice, this list of conditions and the following\012 *    disclaimer in the documentation and/or other materials provided\012 *    with the distribution.\012\012 * THIS SOFTWARE IS PROVIDED BY THE COPYRIGHT HOLDERS AND CONTRIBUTORS\012 * \"AS IS\" AND ANY EXPRESS OR IMPLIED WARRANTIES, INCLUDING, BUT NOT\012 * LIMITED TO, THE IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS\012 * FOR A PARTICULAR PURPOSE ARE DISCLAIMED. IN NO EVENT SHALL THE\012 * COPYRIGHT OWNER OR CONTRIBUTORS BE LIABLE FOR ANY DIRECT, INDIRECT,\012 * INCIDENTAL, SPECIAL, EXEMPLARY, OR CONSEQUENTIAL DAMAGES\012 * (INCLUDING, BUT NOT LIMITED TO, PROCUREMENT OF SUBSTITUTE GOODS OR\012 * SERVICES; LOSS OF USE, DATA, OR PROFITS; OR BUSINESS INTERRUPTION)\012 * HOWEVER CAUSED AND ON ANY THEORY OF LIABILITY, WHETHER IN CONTRACT,\012 * STRICT LIABILITY, OR TORT (INCLUDING NEGLIGENCE OR OTHERWISE)\012 * ARISING IN ANY WAY OUT OF THE USE OF THIS SOFTWARE, EVEN IF ADVISED\012 * OF THE POSSIBILITY OF SUCH DAMAGE.\012\012 * The views and conclusions contained in the software and\012 * documentation are those of the authors and should not be\012 * interpreted as representing official policies, either expressed or\012 * implied, of the FreeBSD Project.\012 ****************************************************************/\012\012/*\012 * CMU 18643 Fall 2017 Lab Exercise\012 *\012 * The paramters in this file sets the problem sizes\012 *\012 */\012\012/* \012 * weights parameters\012 */\012#define K_wts (4) // weight width and height (square)\012//                   // same depth as output\012#define S_wts (1) // sliding stride\012\012// /* \012//  * output feature map paramters\012//  */\012#define R_ofm (16) // height\012#define C_ofm (16) // width\012#define M_ofm (128) // depth\012\012/*\012 * input feature map paramters\012 */\012#define N_ifm (128) // depth\012#define R_ifm (R_ofm*S_wts+K_wts-S_wts) // derived height\012#define C_ifm (C_ofm*S_wts+K_wts-S_wts) // derived width\012\012// Block size. Affects the kernel, so if this value changes, the kernel\012// needs to be recompiled.\012#ifndef BLOCK_SIZE\012#define BLOCK_SIZE 3 // default value, better to be multiple of Tr, Tm, Tc\012#endif\012\012/*\012 * access macro\012 */\012#define ARRAY(ptr,i3,i2,i1,i0,d3,d2,d1,d0) (*((ptr)+(i3)*(d2)*(d1)*(d0)+(i2)*(d1)*(d0)+(i1)*(d0)+(i0)))\012\012#define MIN(a,b) (((a)<(b))?(a):(b))\012\012#define RANGE (100)\012\012#define EPSILON (1e-4)  // do not change this value\012\012/*\012 * Blocking parameters\012 */\012// #define Tr 8 // output row\012// #define Tc 8// output column\012// #define Tm 32 // output depth\012// #define Tn 32  // input depth\012\012#define max_Tr 16 // max buffer size -- R dimension\012#define max_Tc 16   // max buffer size -- C dimension\012#define max_Tm 128 // max buffer size -- M dimension\012\012#endif\012"}];
